import './App.css';
import React from 'react';
import './App.css';
import {BrowserRouter, Routes, Route } from 'react-router-dom';
import Provider from './context/Provider';
import Home from './pages/Home';

function App() {
  return (

    <Provider>
      <BrowserRouter>
      <Routes>
        <Route path="/*" element={ <Home/> }  />
      </Routes>
      </BrowserRouter>
    </Provider>

  );
}

export default App;
